function write(sJson){var oJson=JSON.parse(sJson);var aText=oJson.data.split('||');var sType=aText[0];var sText=aText[1];var sClass="stack-topright";oContent={title:sType,type:sType,textTrusted:true,text:sText,modules:new Map([...PNotify.defaultModules,[PNotifyDesktop,{title:sType,text:sText.replace(/<\/?[^>]+(>|$)/g,"")}]])};if('notice'===sType){PNotify.notice(oContent);}
if('info'===sType){PNotify.info(oContent);}
if('success'===sType){PNotify.success(oContent);}
if('error'===sType){PNotify.error(oContent);}}